import React, {useState, useEffect} from 'react';
import Togglebutton from './Togglebutton';
import {Routes, Route} from 'react-router-dom';

function Predict(){
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('/predictions').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )  
    }, [])
}

export default Predict;
